const SplashScreen = () => {
  return (
    <div className="flex items-center justify-center min-h-screen bg-white">
      <div className="text-center">
        <h1 className="text-3xl font-bold text-blue-700">@KiranaWala</h1>
        <p className="text-sm mt-2">by ideasyogi</p>
        <img src="/logo.png" alt="App Logo" className="mx-auto mt-4 w-32 h-32" />
        </div>
    </div>
  );
};

export default SplashScreen;
